import React from "react";
import { BsPlus } from "react-icons/bs";
import { FiInbox } from "react-icons/fi";

function Pool() {
  return (
    <>
      <div className="w-full h-full dark:bg-gray-700 py-32">
        <div className="w-1/2 m-auto">
          <div className="flex justify-between p-4 items-center">
            <p className="text-3xl text-[#ffffff]">Pools</p>{" "}
            <button className="flex items-center gap-1 bg-red-500 px-4 py-2 text-lg hover:bg-red-600 rounded-md text-[#FFFFFF] font-medium">
              <BsPlus className="text-2xl text-white" /> New Position
            </button>
          </div>
          <div className="w-[95%] h-80 m-auto mt-8 p-4 grid place-items-center rounded-2xl border border-gray-600">
            <p className="w-[40%]  text-[#ffffff] text-lg text-center">
              <FiInbox className="text-5xl" />
              Your active V3 liquidity positions will appear here.
            </p>
          </div>
        </div>
      </div>
    </>
  );
}

export default Pool;
